@benjamistan @UniswapExchange 8)

To answer the question thought - having both assets is pretty essential to core functionality

You could allow someone to add in one asset but thats the same as trading half of your value into the other asset (which moves the price). It can be done externally (see @DeFi_Zap )

@benjamistan @UniswapExchange 7/

One benefit to this is that if you believe it is a good strategy, you can add liquidity once and don't need to update / actively manage it.

Another benefit is you can pool across small LPs to form a single market maker - something that is only done by whales in orderbooks

@benjamistan @UniswapExchange 6/

In orderbooks, you just put up buy/sell offers and the difference between retail trades and market makers is how many you put up and at what price

Uniswap makes the act of market making explicit - you get a specific spread and are opting into a specific rebalancing strategy.

@benjamistan @UniswapExchange 5/

This formula has the added benefit of setting prices such that you always have 50% in value in each asset removing the need for rebalancing.

So you need both tokens because uniswap is an automated market maker - and having both tokens is core to what market making is.

@benjamistan @UniswapExchange 4/

Uniswap mimics all this functionality using an automated market making system instead of an order book.

The ‚Äúfee‚Äù is similar to spread and the x*y=k formula adjusts for price movement by dynamically setting the rate along a smooth curve instead of at discrete intervals.

@benjamistan @UniswapExchange 2/

This price difference (called the spread) is what allows market makers to be profitable.


Market makers also need to account for quick price movements by raising prices as more of their reserves are purchased. This is done by placing lots of orders at difference prices.

@benjamistan @UniswapExchange 1/

Uniswap is a system for pooled automated market making.

On traditional exchanges market makers maintain reserves in assets on both sides of a pair, and are willing to trade in either direction. Sell orders are set at a slightly higher price than buy orders.

